import SettingsButton from './SettingsButton';

function SearchPage() {



  return (

    <section className="garamond">
			<div className="navy georgia ma0 grow">
        <h1>Lumos</h1>
        <SettingsButton/>
			</div>
			<div className="pa2">
				<input
					className="pa3 bb br3 grow b--none bg-lightest-blue ma3"
